import React, { Component } from 'react';
import ReactDom from 'react-dom';
import { Carousel, Item, Caption, Card, Col, Figure,Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.css';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css'
import ReactDOM from 'react-dom';
import './vehicle.css'


export default function Vehicle_detail(props) {
//alert(props.vehicle_name);
    return (
        <div className="col-12 col-md-12 col-lg-12">

            <Card className="col-12 col-md-12 col-lg-12">
                <Card.Header>{props.vehicle_name}</Card.Header>
                <Card.Body >

                    <img className="imgsize" src={process.env.PUBLIC_URL+"tata_sumo.jpg"} />

                    <Button variant="primary">Go somewhere</Button>
                </Card.Body>
            </Card>


        </div>



    )


}
